import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_view.png'));

    // Open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_opened.png'));

    // Verify menu content is visible
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });
    const menuText = await page.textContent('.mobile-menu');

    // Click on a category link
    await page.waitForSelector('a[href="#"]', { timeout: 5000 });
    await page.click('a[href="#"]:has-text("Electronics")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_category_selected.png'));

    // Close mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');
    await page.waitForSelector('#mobileMenuOverlay:not(.show)', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation - opened menu, selected Electronics category, and closed menu",
      extractedData: {
        menuContent: menuText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
